import React from "react";
import { Container, Row,Button} from 'reactstrap'
import {NavLink, Link} from 'react-router-dom'

import logo from '../../assets/images/logo.png';
import './header.css';

const nav__links=[
    {
        path:'/home',
        display:'home'
    },
    {
        path:'/',
        display:'About'
    },
    {
        path:'/tours',
        display:'tours'
    },
]

const Header = () => {
  return (
    <header classname="header">
      <Container>
        <Row>
          <div className="nav__wrapper d-flex align-items-center justify-content-between">
            { /* ============ logo ========== */}
            <div className="logo">
              <img src={logo} alt="" />
              </div>
              { /* ============ logo end ========== */}
              { /* ============ menu start ========== */}
              <div className="navigation">
                <ul className="menu d-flex align-items-center gap-5">
                  {
                  nav__links.map((item,index)=>(
                    <li className="nav_items" key={index}>
                      <NavLink to={item.path} className={navClass=> navClass.isActive ? "action__link": ""
                    } >{item.display}</NavLink>
                    </li>
                  ))}
                  </ul>
                  </div>
                  { /* ============ menu ends ========== */}
                  <div className="nav__right d-flex align-items-centergap-4 ">
                    <div className="nav__btn d-flex align-items-centergap-4 ">
                      <Button classname="btn secondary__btn"><link to='/login'>login</link></Button>
                      <Button classname="btn primary__btn"><link to='/register'>Register</link></Button>
                    </div>

                    <span className="mobile__menu">

                    </span>
                  </div>

          </div>
        </Row>       
      </Container>
    </header>
  );
};

export default Header;
